import './App.css';
import React from 'react';
import HomeFeature from './features/home';
import { Route } from 'react-router-dom/cjs/react-router-dom.min';

function App() {
  return (
    <div className="App">
      <Route path='/home' component={ HomeFeature } exact/>
    </div>
  );
}

export default App;
